		for(i = 0; i < l; i++){
			keyarray[i]=parseInt((keyarray[i].charCodeAt(0)+i*69)/10);
		}
		for(i = 0; i < +l; i++){
			keyarray[i]=(keyarray[i]+keyarray[l-1-i]);
		}
		
		
		
		kr=0;
